var minOperations = function(nums, k) {
    // Create a Set containing the elements we need to collect
    const elementsToCollect = new Set();
    for (let i = 1; i <= k; i++) {
        elementsToCollect.add(i);
    }

    // Iterate through the array backwards
    let operations = 0;
    for (let i = nums.length - 1; i >= 0; i--) {
        operations++; // We perform an operation by removing the last element
        if (elementsToCollect.has(nums[i])) {
            elementsToCollect.delete(nums[i]); // Remove the collected element from the Set
        }
        if (elementsToCollect.size === 0) {
            return operations; // If we've collected all needed elements, return the operations count
        }
    }

    // If the loop completes without returning, it means we have not been able to collect all elements
